import React, {Component, Fragment} from 'react';
import Topbanner from '../component/home_component/topBanner';
import Counter from '../component/counter_component/counter';

class HomePage extends Component{

   render(){
        return (
            <Fragment>
                <Topbanner />
                

                <div>
                <h1 className='homeTitle text-center'>This is My Counter</h1>
                <Counter />
                </div>
            </Fragment>
)
}
}
export default HomePage;
